-- --------------
-- SAMPLE (OTHER)
-- --------------

UPDATE inp_dwf set pattern1='DAILY_PATTERN', avg_value= 0.0001 where fid<25;
UPDATE inp_dwf set pattern2='MONTHLY_PATTERN', avg_value=0.0001 where fid between 25 and 30;
UPDATE inp_dwf set pattern3='HOURLY_PATTERN', avg_value=0.0002 where fid between 31 and 45;
UPDATE inp_dwf set pattern4='WEEKEND_PATTERN', avg_value=0.0003 where fid>45;

-- junctions
update inp_junction set y0 = 0, ysur = 0, apond = 0;

-- roof
UPDATE roof SET slope = 1.5, width = 30, outlet_vol =100, street_vol=0, infiltr_vol=0, roughness = 0.018;
UPDATE roof SET isconnected=1;

-- inlet
UPDATE inlet SET outlet_type = 'TO NETWORK', method = 'W_O', weir_cd = 1.6 , orifice_cd = 0.7, efficiency = 90 , width = 1, length = 0.2;
UPDATE inlet SET outlet_type = 'SINK', method = 'W_O', a_param = 0.496 , b_param = 0.712, efficiency = 90 , width = 1, length = 0.2 where fid = 44;

-- ground
update ground set landuse = 'OPEN SPACE', custom_roughness = 0.02, scs_cn = 85;

-- outfall
UPDATE inp_outfall set gate = 'NO', curve = 'PUMP-02';

--conduit
UPDATE inp_conduit SET geom3 = 0, geom4 = 0, q0 = 0, qmax = 0;
--UPDATE inp_conduit set curve_transect = 'TRANSECT_DEMO' WHERE shape = 'IRREGULAR';
UPDATE inp_conduit set curve_transect = 'SHAPE_DEMO' WHERE shape = 'CUSTOM';
UPDATE inp_conduit SET roughness = 0.012;
UPDATE inp_conduit set geom1=1, geom2=1 where shape='RECT_OPEN';
UPDATE inp_conduit set geom2=1 where shape='FORCE_MAIN' AND geom2=0;


UPDATE inp_weir set node_1 = 'S1' where code = 'W1';

-- fix extent of layers
UPDATE gpkg_contents SET min_x = a.min_x, min_y = a.min_y, max_x = a.max_x, max_y = a.max_y FROM (SELECT MIN(st_minx(geom)) AS min_x, MIN(st_miny(geom)) AS min_y, MAX(st_maxx(geom)) AS max_x, MAX(st_maxy(geom)) AS max_y FROM ground)a WHERE table_name = 'ground';
UPDATE gpkg_contents SET min_x = a.min_x, min_y = a.min_y, max_x = a.max_x, max_y = a.max_y FROM (SELECT MIN(st_minx(geom)) AS min_x, MIN(st_miny(geom)) AS min_y, MAX(st_maxx(geom)) AS max_x, MAX(st_maxy(geom)) AS max_y FROM roof)a WHERE table_name = 'roof';
